import React from 'react';
import './App.css';

import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <Link to="/">Home</Link>
      <Link to="/listings">Browse Listings</Link>
      <Link to="/submit">Submit Car</Link>
      <Link to="/login">Login</Link>
    </nav>
  );
}

export default Navbar;
